func testBookToManyAddOpBookIdNewBooksLogs(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Book
	var b, c, d, e BooksLog

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, bookDBTypes, false, strmangle.SetComplement(bookPrimaryKeyColumns, bookColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*BooksLog{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, booksLogDBTypes, false, strmangle.SetComplement(booksLogPrimaryKeyColumns, booksLogColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*BooksLog{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddBookIdNewBooksLogs(ctx, tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if !queries.Equal(a.BookId, first.BookIdNew) {
			t.Error("foreign key was wrong value", a.BookId, first.BookIdNew)
		}
		if !queries.Equal(a.BookId, second.BookIdNew) {
			t.Error("foreign key was wrong value", a.BookId, second.BookIdNew)
		}

		if first.R.BookIdNew != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.BookIdNew != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.BookIdNewBooksLogs[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.BookIdNewBooksLogs[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.BookIdNewBooksLogs().Count(ctx, tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}

