func testBookToOnePersonUsingAuthorId(t *testing.T) {
	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var local Book
	var foreign Person

	seed := randomize.NewSeed()
	if err := randomize.Struct(seed, &local, bookDBTypes, true, bookColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Book struct: %s", err)
	}
	if err := randomize.Struct(seed, &foreign, personDBTypes, true, personColumnsWithDefault...); err != nil {
		t.Errorf("Unable to randomize Person struct: %s", err)
	}

	if err := foreign.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	queries.Assign(&local.AuthorId, foreign.PeopleId)
	if err := local.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	check, err := local.AuthorId().One(ctx, tx)
	if err != nil {
		t.Fatal(err)
	}

	if !queries.Equal(check.PeopleId, foreign.PeopleId) {
		t.Errorf("want: %v, got %v", foreign.PeopleId, check.PeopleId)
	}

	slice := BookSlice{&local}
	if err = local.L.LoadAuthorId(ctx, tx, false, (*[]*Book)(&slice), nil); err != nil {
		t.Fatal(err)
	}
	if local.R.AuthorId == nil {
		t.Error("struct should have been eager loaded")
	}

	local.R.AuthorId = nil
	if err = local.L.LoadAuthorId(ctx, tx, true, &local, nil); err != nil {
		t.Fatal(err)
	}
	if local.R.AuthorId == nil {
		t.Error("struct should have been eager loaded")
	}
}

